const data = require("../dictionary/data/chords.json");

const out = {};

Object.keys(data).forEach(name => {
  const [intervals, names] = data[name];
  out[intervals] = [name, ...(names || [])];
});

console.log("module.exports = {");
Object.keys(out)
  .sort()
  .forEach(name => {
    console.log(`"${name}":`, out[name], ",");
  });
console.log("};");
